FeedPackage.ReleaseNotes:
1. Added support of the item transformations (classes that implements an IItemTransform interface);
2. Added the NullBuilder class (implements an IBundleBuilder interface) that responsible for prevention of early applying of the item transformations and combining of code;
3. Implemented analogs of the StyleBundle and ScriptBundle classes for the Bundle Transformer: CustomStyleBundle (uses CssTransformer as transformation by default and NullBuilder as builder by default) and CustomScriptBundle (uses JsTransformer as transformation by default and NullBuilder as builder by default);
4. In the css configuration element added the disableNativeCssRelativePathTransformation attribute, which disables native transformation of relative paths to absolute in CSS-files.

1. Added the NullBuilder class (implements an IBundleBuilder interface) that responsible for prevention of early combining of code;
2. Implemented analogs of the StyleBundle and ScriptBundle classes for the Bundle Transformer: CustomStyleBundle (uses CssTransformer as transformation by default and NullBuilder as builder by default) and CustomScriptBundle (uses JsTransformer as transformation by default and NullBuilder as builder by default);
3. In the css configuration element added the disableNativeCssRelativePathTransformation attribute, which disables native transformation of relative paths to absolute in CSS-files.

1. Appeared a new type of modules - postprocessor (runs after translators and before minifiers);
2. Debugging HTTP-handlers can now use a item transformations, postprocessors and other configuration settings from bundles;
3. Classes `CssTransformer` and `JsTransformer` are deprecated. Instead, should use classes `StyleTransformer` and `ScriptTransformer` respectively.
4. Earlier file extension mappings were hard coded in the `Asset` class, and now it are specified in the Web.config file.

1. Added support of CSSO version 1.2.18;
2. Fixed a bug, that occurred when processing of large CSS-files, by replacing the EcmaScript.Net on the Noesis Javascript. NET;
3. BundleTransformer.Csso was divided into 2 libraries: BundleTransformer.Csso.x86 and BundleTransformer.Csso.x64.

1. Added support of CSSO version 1.2.18;
2. Fixed a bug, that occurred when processing of large CSS-files, by replacing the EcmaScript.Net on the Noesis Javascript. NET;
3. BundleTransformer.Csso was divided into 2 libraries: BundleTransformer.Csso.x86 and BundleTransformer.Csso.x64.

1. Added support of LESS version 1.5.0;
2. In configuration settings of LESS-translator added new property - `JavascriptEnabled`;
3. From `/configuration/system.web/httpHandlers` element of the Web.config file was removed a debugging HTTP-handler, that used for working in the IIS Classic mode.

1. No longer made preprocessing of `@import` directives and `data-uri` functions;
2. Interpolation in file paths is now supported;
3. In configuration settings of LESS-translator was added one new property - `Severity` (default `0`).

1. Added support of LESS version 2.6.1;
2. No longer made preprocessing of `@import` directives and `data-uri` functions;
3. Interpolation in file paths is now supported;
4. In configuration settings of LESS-translator was added one new property - `Severity` (default `0`).

1. Added support of the Microsoft Ajax Minifier version 5.14;
2. In the `CssColor` enumeration added new value - `NoSwap`;
3. In CSS minification settings changed the default value for `ColorNames` property (instead of `Strict` now is used `Hex`).
